import {BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Deshboard_AD from "./pages/admin/adminDeshboard";
import ScrollToTop from './components/comman/ScrollHandle';
import Deshboard_DR from './pages/doctor/doctorDeshboard';
import Deshboard_CP from './pages/compounder/compounderDeshboard';
import RegistrationForm from './components/compounder/NewRegistrationForm';
import EncounterForm from './components/compounder/Encounter';
import Home from './pages/home/home';

function App() {
  return (
    <div>
      <Router>
        <ScrollToTop></ScrollToTop>
        <Routes>
          <Route path='/' element={<Home></Home>}/>          
          <Route path='admin' element={<Deshboard_AD></Deshboard_AD>}/>
          <Route path='doctor' element={<Deshboard_DR></Deshboard_DR>} />
          <Route path='compounder' element={<Deshboard_CP></Deshboard_CP>}/>
          <Route path="compounder/registration" element={<RegistrationForm />} />
          <Route path="compounder/encounter" element={<EncounterForm></EncounterForm> } />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
